import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Card from 'react-bootstrap/Card';

function App() {
  return (
    <div className="App">
      <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand href="#home">Coffee Lovers ☕️</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Pricing</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
      <div className="content position-relative text-center align-items-center">
        <div className="mainPage position-absolute top-50 start-50 translate-middle">
          <h1 className="py-1">Coffee Lovers</h1>
          <h1 className="py-5">Teaches you how to make a damn good cup of coffee, The right way!</h1>
          <Button>Get Started</Button>
        </div>
      </div>
      <div class="card text-start">
        <img class="card-img-top" src="text-start" alt="Title"/>
        <div class="card-body">
          <h4 class="card-title">Title</h4>
          <p class="card-text">Body</p>
        </div>
      </div>

    </div>
  );
}

export default App;
